Overload.descr:
Breaks a string into an array of substrings. Delimiters is a string containing one or more delimiter characters. The default delimiter set ' 	
' (space, tab, newline, return) is used if delimiters is an empty string or split is called with only one argument. Multiple delimiters in the string are merged (taken as one) and delimiters at the start or end of the string are ignored unless the delimiter is a single comma, a single semicolon or a regular expression. With ImageJ 1.49f or later, delimiters can be also a regular expression enclosed in parentheses, e.g. delimiters='(

)' splits only at empty lines (two newline characters following each other).
